import React from "react";
import Navbar from "./components/Navbar"
import Filter from "./components/Filter"
import Cards from "./components/Card"
import {apiUrl,filterData} from "./data"

const App = () => {
    
  useEffe
  return(
    <div>
      
      <Navbar></Navbar>
       <Filter filterData={filterData}/>

      <Cards/> 
      
    </div>
  );
   
};

export default App;
